import { withRouter } from 'next/router';

const A = ({ query, name }) => (<div>A {query.id} {name}</div>);

A.getInitialProps = async ({ req, query }) => {
  console.log('--------------');
  return ({ query, name: 'jocky' });
};

export default withRouter(A);
